  \"2016-11-25T21:06:14.487854\",\n\t\"name\": \"educational-technology-in-public-schools-2008\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Educational Technology in Public Schools,
  2008 (FRSS 92), is a study that is part of the Fast Response Survey System (FRSS)
  program; program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
  FRSS 92 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides national
  estimates on the availability and use of educational technology in public elementary
  and secondary schools during fall 2008. This is one of a set of three surveys (at
  the district, school, and teacher levels) that collected data on a range of educational
  technology resources. The study was conducted using mailed questionnaires and respondents
  had the option of completing the survey via the web. Schools were sampled. The study's
  weighted response rate was 79 percent. Key statistics produced from FRSS 92 were
  information on computer hardware and internet access, availability of staff to help
  integrate technology into instruction and provide timely technical support, and
  perceptions of educational technology issues at the school and district levels.
  Respondents reported the number of instructional computers within their schools,
  by type, mobility, and location. The survey also asked respondents about the types
  of operating systems or platforms used on instructional computers. Data on the number
  of handheld devices provided to school personnel and students, and the number of
  other technology devices provided for instructional purposes were also collected.
  Respondents indicated the extent to which technology staff provided assistance with
  technology support and integration and the response times for obtaining such support.
  Respondents gave opinions on statements related to using educational technology
  in their schools.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
